(1, 1, 1, '2021-06-28', 1, 2, 0.30, 0.69, 'das dasd asd sad asd asd as dasd sasda', 1, 'Test powodu decyzji'),
(2, 1, 1, '2021-06-29', 1, 2, 0.30, 0.29, 'sdad sadsa dsa dasdas da dasd adsa', 0, 'dsadsa dsadsa sda'),
(7, 23, 8, '2021-09-21', 13, 12, 0.10, 0.13, 'jestem juz w firmie od 23.6 czyli juz prawie 3 miechy a Żółtodzióba sie ma dwa no i duzo jezdze xd', 1, 'Pozytywnie rozpatrzone'),
(8, 15, 8, '2021-09-21', 2, 2, 0.10, 0.15, 'Dzień Dobry jako że jestem juz w firmie 7 miesięcy i mam dosyć duża akrywnosć w firmie gdzie wyrabiam miesięczne limity oraz jezdze konwoje firmowe jak i międzyfirmowe  wiec wnioskuje o podzywzke z góry dziękuję i pozdrawiam.', 1, 'Pozytywnie rozpatrzone'),
(9, 8, 8, '2021-09-22', 1, 1, 0.10, 0.15, 'Jako szef nie muszę mówić że muszę zarabiać najwięcej XD. Ogólnie wydaje mi się że zasługuję na maksa pieniędzy na stanowisku Stażysta gdyż moja frekwencja jest 100% na konwojach oraz angaż w firmę jest bardzo wysoki. Trasy i ładunki czasem mają jakieś błędy czy uszkodzenia ale nie myli się ten co nie robi nic. Czekam z niecierpliwością na odpowiedź. Pozdrawiam ', 1, 'Pozytywnie rozpatrzone'),
(10, 10, 10, '2021-09-29', 2, 12, 0.10, 1.00, 'składam bo musze :D', 0, '123'),
(11, 10, 8, '2021-09-29', 2, 2, 0.10, 1.00, 'składam bo musze ^^', 0, 'Kurwa za dużo \r\n'),
(12, 10, 10, '2021-09-29', 2, 2, 0.10, 15.00, 'Wypełniam pole', 0, '123'),
(13, 10, 8, '2021-09-29', 2, 2, 0.10, 0.15, 'wypełniam pole ', 1, 'Pozytywnie rozpatrzone'),
(14, 18, 8, '2021-09-30', 13, 12, 0.10, 0.15, 'No szefie juz tak długo pracuje u ciebie i rzetelnie wykonuje swoją pracę. Żadnych skarg nie bylo na mnie a wiec chyba czas juz cos pomyslec o mojej stawce i małej podwyżce.\r\nO to moja propozycja i licze na pozytywne rozpatrzenie.\r\nPozdrawiam ', 1, 'Pozytywnie rozpatrzone'),
(15, 31, 1, '2021-12-27', 13, 12, 0.10, 0.14, 'test powod', 1, 'Nie podano powodu odrzucenia.'),
(16, 1, 0, '2023-01-17', 1, 1, 0.30, 0.36, 'gfdgfd', NULL, NULL),
(17, 36, 36, '2023-01-17', 1, 1, 0.10, 0.30, 'Bo mało mamony.', 1, 'Zaakceptowano'),
